package sliding_window.permutation_in_string;

import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.Arguments;
import org.junit.jupiter.params.provider.MethodSource;

import java.util.stream.Stream;

import static org.assertj.core.api.Assertions.assertThat;

class PermutationInStringTest {

  @ParameterizedTest
  @MethodSource("inputs")
  void test(String s1, String s2, boolean expected) {
    var permutationInString = new PermutationInString();

    boolean inclusion = permutationInString.checkInclusion(s1, s2);

    assertThat(inclusion).isEqualTo(expected);
  }

  private static Stream<Arguments> inputs() {
    return Stream.of(
        Arguments.of("ab", "eidbaooo", true),
        Arguments.of("ab", "ab", true),
        Arguments.of("eidboaoo", "ab", false),
        Arguments.of("ab", "eidboaoo", false),
        Arguments.of("abc", "abdabdcbamn", true),
        Arguments.of("hello", "ooolleoooleh", false),
        Arguments.of("adc", "dcda", true),
        Arguments.of("abc", "bcdbbcba", true),
        Arguments.of("abc", "abdabdbacmn", true),
        Arguments.of(
            "",
            "",
            true),
        Arguments.of(
            "vxqakfyaqahufxfizupjrkkifjlbfqfeprqrfjvxnubntdtlvz",
            "",
            true));
  }
}
